webpackJsonp([0x69705e2e562c],{2545:function(s,o){s.exports={pathContext:{docHtml:"<h1>path-is-absolute <a href=\"https://travis-ci.org/sindresorhus/path-is-absolute\"><img src=\"https://travis-ci.org/sindresorhus/path-is-absolute.svg?branch=master\" alt=\"Build Status\"></a></h1>\n<blockquote>\n<p>Node.js 0.12 <a href=\"http://nodejs.org/api/path.html#path_path_isabsolute_path\"><code>path.isAbsolute()</code></a> <a href=\"https://ponyfill.com\">ponyfill</a></p>\n</blockquote>\n<h2>Install</h2>\n<pre><code>$ npm install --save path-is-absolute\n</code></pre>\n<h2>Usage</h2>\n<pre><code class=\"language-js\">const pathIsAbsolute = require('path-is-absolute');\n\n// Running on Linux\npathIsAbsolute('/home/foo');\n//=> true\npathIsAbsolute('C:/Users/foo');\n//=> false\n\n// Running on Windows\npathIsAbsolute('C:/Users/foo');\n//=> true\npathIsAbsolute('/home/foo');\n//=> false\n\n// Running on any OS\npathIsAbsolute.posix('/home/foo');\n//=> true\npathIsAbsolute.posix('C:/Users/foo');\n//=> false\npathIsAbsolute.win32('C:/Users/foo');\n//=> true\npathIsAbsolute.win32('/home/foo');\n//=> false\n</code></pre>\n<h2>API</h2>\n<p>See the <a href=\"http://nodejs.org/api/path.html#path_path_isabsolute_path\"><code>path.isAbsolute()</code> docs</a>.</p>\n<h3>pathIsAbsolute(path)</h3>\n<h3>pathIsAbsolute.posix(path)</h3>\n<p>POSIX specific version.</p>\n<h3>pathIsAbsolute.win32(path)</h3>\n<p>Windows specific version.</p>\n<h2>License</h2>\n<p>MIT Â© <a href=\"https://sindresorhus.com\">Sindre Sorhus</a></p>",docPath:"argo-ci/node_modules/fsevents/node_modules/path-is-absolute/readme",proj:"argo-ci"}}}});
